import React, { useEffect, useState } from 'react';

const SgbdOverview = () => {
  const [sgbdData, setSgbdData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Simulate fetching data with a delay
        await new Promise(resolve => setTimeout(resolve, 1000));

        // Generate random data
        const randomData = {
          version: `8.0.${Math.floor(Math.random() * 30)}`,
          uptime: Math.floor(Math.random() * 1000000),
          openTables: Math.floor(Math.random() * 1000),
          totalQueries: Math.floor(Math.random() * 1000000),
        };

        setSgbdData(randomData);
      } catch (error) {
        setError('Failed to load data');
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>SGBD Overview</h1>
      {sgbdData ? (
        <div>
          {/* Display SGBD Data */}
          <p><strong>Version:</strong> {sgbdData.version}</p>
          <p><strong>Uptime:</strong> {sgbdData.uptime} seconds</p>
          <p><strong>Total Queries:</strong> {sgbdData.totalQueries}</p>
          <p><strong>Open Tables:</strong> {sgbdData.openTables}</p>
        </div>
      ) : (
        <p>Failed to load data: {error}</p>
      )}
    </div>
  );
};

export default SgbdOverview;
